<style>body{font-family:"Lucida Grande",Verdana,Arial,Helvetica,sans-serif;font-size:11px;color:#333;background:#cad2d9;margin:0}.voice{position:absolute;border:0;clip:rect(0 0 0 0);width:1px;height:1px;margin:-1px;padding:0;overflow:hidden}input,button{font-family:inherit;font-size:inherit;vertical-align:middle}input[type="text"],input[type="password"]{margin:0;padding:4px;border:1px solid #b2b2b2;border-radius:4px}input[type="text"]:focus,input[type="password"]:focus,button:focus,input.button:focus,textarea:focus{border-color:#4787b1;box-shadow:0 0 5px 2px rgba(71,135,177,0.9);outline:0}input[type="text"]:required,input[type="password"]:required{border-color:#4787b1}button{display:inline-block;margin:0 2px;border:1px solid silver;text-decoration:none;outline:0}.formbuttons button{font-size:110%;padding:4px 12px;border-radius:5px;box-shadow:0 1px 1px 0#ccc}.formbuttons button:hover,.formbuttons button:focus,.formbuttons input.button:hover,.formbuttons input.button:focus,input.button.mainaction:hover,input.button.mainaction:focus{color:#f2f2f2;border-color:#465864;box-shadow:0 0 5px 2px rgba(71,135,177,0.6)}.formbuttons button:active,.formbuttons input.button:active{color:#fff;background:#5f5f5f}button.mainaction{background:#2c2f33}button.mainaction:active,input.button.mainaction:active{color:#fff;background:#515151;background:-moz-linear-gradient(top,#2a2e31 0,#505050 100%);background:-webkit-gradient(linear,left top,left bottom,color-stop(0,#2a2e31),color-stop(100%,#505050));background:-ms-linear-gradient(top,#2a2e31 0,#505050 100%);background:linear-gradient(to bottom,#2a2e31 0,#505050 100%)}button.mainaction{font-weight:bold!important}button:focus,a.button:focus,input.button:focus{border-color:#017db6;box-shadow:0 0 2px 1px rgba(71,135,177,0.6);outline:0}a.button.pressed,a.button:active,button:active,input.button:active{background:#f7f7f7}@media screen and (-webkit-min-device-pixel-ratio:0) and (max-device-width:1024px){}#login-form{position:relative;width:580px;margin:20ex auto 2ex auto;text-align:center}#login-form .box-inner{width:430px;background:-webkit-gradient(linear,left top,left bottom,color-stop(0,#404040),color-stop(100%,#2e2e2e));background:-ms-linear-gradient(top,#404040 0,#2e2e2e 100%);background:linear-gradient(to bottom,#404040 0,#2e2e2e 100%);margin:0 50px;padding:10px 24px 24px 24px;border-radius:6px}#login-form .box-bottom{margin-top:-3px;padding-top:10px}#login-form td.input{width:80%;padding:8px}#login-form input[type="text"],#login-form input[type="password"]{width:100%;border-color:#666}#login-form button.button{color:#444;border-color:#f9f9f9;background-color:#f9f9f9}#login-form button.button:active{color:#333;background-color:#dcdcdc}#login-form form table{width:98%}#login-form td.title{width:20%;white-space:nowrap;color:#cecece;text-align:right;padding-right:1em}#login-form p.formbuttons{margin-top:2em;text-align:center}#login-form #logo{margin:20px;border:0}#login-form #message{min-height:40px;padding:5px 25px;text-align:center;font-size:1.1em}#bottomline{font-size:90%;text-align:center;margin-top:2em}</style>
